import React from 'react';

import { BsHeartFill, BsHeart, BsUpload, BsBookmark, BsBookmarkFill, BsChat } from "react-icons/bs";

const Toolbar = () => {
  return(
    <div>
      <table>
        <tbody>
          <tr>
            <td style={{fontSize: '24px', width: '25px', paddingLeft:'10px'}}><BsHeart /></td>
            <td style={{fontSize: '24px', width: '25px'}}><BsChat /></td>
            <td style={{fontSize: '24px', width: '25px'}}><BsUpload /></td>
            <td style={{textAlign: 'right', paddingRight:'10px', fontSize: '24px'}}><BsBookmark /></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default Toolbar;
